def mood_analyse(final_data):
	n=len(final_data[0])
	if n>2:
		if Counter(final_data[2]).most_common()[0][0] in ["happiness","surprise","neutral"]:
			return "friendship happy"
		else:
			return "friendship sad"
	elif n==2:
		if ("male" in final_data[1]) and ("female" in final_data[1]) and (final_data[0][0]>14) and (final_data[0][1]>14) and (max(final_data[0])-min(final_data[0])<15):
			return "romantic"
		else:
			if Counter(final_data[2]).most_common()[0][0] in ["happiness","surprise","neutral"]:
				return "friendship happy"
			else:
				return "friendship sad"
	else:
		if final_data[0][0]<10:
			return "children"
		elif final_data[0][0]>50:
			if final_data[2][0]=="happiness" or final_data[2][0]=="neutral":
				return "happy old"
			elif final_data[2][0]=="sadness":
				return "sad old"
			elif final_data[2][0]=="surprise":
				return "energetic old"
			else:
				return "soothing old"
		else:
			if final_data[2][0]=="happiness" or final_data[2][0]=="neutral":
				return "happy"
			elif final_data[2][0]=="sadness":
				return "sad"
			elif final_data[2][0]=="surprise":
				return "energetic"
			else:
				return "soothing"

def songs(url1, url2, url3):
	final_list=[]
	html = urllib.urlopen(url1).read()
	soup = BS(html,"html.parser")
	count=0
	for url in soup.find_all('a'):
	#if "https://gaana.com/song/" in url.get('href')
		s = str(url.get('href'))

		if s.startswith("https://gaana.com/song/",0,23):
			count+=1
			url=str(url)
			final_list.append([s,url[url.find('>')+1:url[1:].find('<')+1]])
		if count==3:
			break

	html = urllib.urlopen(url2).read()
	soup = BS(html,"html.parser")
	count=0
	for url in soup.find_all('a'):
	#if "https://gaana.com/song/" in url.get('href')
		s = str(url.get('href'))
		if s.startswith("https://gaana.com/song/",0,23):
			count+=1
			url=str(url)
			final_list.append([s,url[url.find('>')+1:url[1:].find('<')+1]])
			
		if count==3:
			break

	html = urllib.urlopen(url3).read()
	soup = BS(html,"html.parser")
	count=0
	for url in soup.find_all('a'):
	#if "https://gaana.com/song/" in url.get('href')
		s = str(url.get('href'))
		
		if s.startswith("https://gaana.com/song/",0,23):
			count+=1
			url=str(url)
			final_list.append([s,url[url.find('>')+1:url[1:].find('<')+1]])
		if count==3:
			break

	shuffle(final_list)
	for i in xrange(10):
		song_to_search = final_list[i][1]
		song_to_search.replace(" ","+")
		html = urllib.urlopen("https://www.youtube.com/results?search_query="+song_to_search).read()
		soup = BS(html,"html.parser")
		for url in soup.find_all('a'):
			u = str(url)
			if u.find("watch?v=")!=-1:
				final_list[i].append("<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/"+ u[u.find("watch?v=")+8:] +"\" frameborder=\"0\" gesture=\"media\" allow=\"encrypted-media\" allowfullscreen></iframe>")
				break
	return final_list


